INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 109, 528, 6, 13, 9, 2, '[color=white][b]Lynx[/b] The hunter one - stalks down  answers. Level 6[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 108, 396, 3, 13, 9, 2, '[color=white][b]Badger[/b] The digger one - has information  you cannot find. Level 4[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 383, 488, 32, 13, 9, 2, '[color=white][b]Who are Habbo guides?[/b]  Habbo Guides are experienced players  who like to share their knowledge of  Habbo and welcome new players.  Habbo Guides meet and greet new  Habbos, guide them around and generally making them feel at home.  [b]I\'m new. How do I find a Guide?[/b]  The first time you enter your room in the hotel you will be asked if you would like to meet a Habbo Guide. You can also  identify Guides by their animal badge.   [b]What\'s in it for me?[/b]  A warm fuzzy feeling at the end of the  day, and hopefully the start of many new  friendships :)  [b]Can I join?[/b]  Yes, just join this Group. Anyone who\'s interested in being nice to newcomers is welcome to join - the more the merrier![/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 107, 864, 33, 13, 9, 2, '[color=white][b]Wolf[/b] The eXperienced one with  the knowledge to show the way.  Level X[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 109, 667, 8, 13, 9, 2, '[color=white][b]Bear[/b] The friendly one  - kind and soft. Level 8[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 639, 489, 31, 13, 9, 2, '[color=white][b]How do we find the new people?[/b]  When new people join Habbo we\'ll ask  them if they\'d like to meet a Guide  from Habbo. If they say yes, we\'ll send alerts to members of this group  who are in the Hotel at the same time.  Accept the invitation and you\'ll be  whisked off to meet the new person.  You can guide them around Habbo and  show them what it\'s about.  [b]Can I get as many invites as I want?[/b]  Sure, with the Guide tool, You can  decide when You want to receive the  invites. After helping someone, you can  pick up the next invite. The Guide tool is  shown on your screen (in the hotel), in the top left corner.  [b]What do I get for guiding?[/b]  Habbo Guides receive badges to  reward their good work. There are 10  levels to achieve. If you successfully  guide a Habbo, who stays in Habbo as a  player, is your friend and has spent  enough time online, you will be rewarded.  The more Habbos you help, the  cooler the badge! These badges are not  available anywhere else.[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 109, 461, 5, 13, 9, 2, '[color=white][b]Fox[/b] The clever one - is swift of  thought and foot. Level 5[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 108, 264, 4, 13, 9, 2, '[color=white][b]Bambi[/b] The cutest one - makes you  wanna hug. Level 2[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 110, 596, 7, 13, 9, 2, '[color=white][b]Buffalo[/b] The strong one - the one you  can depend on. Level 7[/color]', 1, '');
