INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 39, 325, 16, 13, 2, 1, '[b]How do I get around?[/b]  Use the Hotel Navigator to get from room to room. The button is at the bottom of your screen and looks like an orange hotel tower. You’ll be able to visit public rooms, guest rooms. You can also start building your own room by clicking on “Create Own Room” under My Rooms.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 291, 556, 113, 13, 2, 1, '[b]What if I see someone breaking the rules?[/b]  If you need help from a moderator, you can:  -Use the Call For Help Emergency System. It’s the blue question mark on the bottom right side of your screen.   -May join our Discord ([i]The widget can be found on the /me page[/i]) and tell us what happened.  -May visit our Help Desk: [b]Room Name:[/b] ClassicHabbo Help Desk [b]Room Owner:[/b] Toya', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 487, 357, 111, 13, 2, 1, '[b]Habbo Lingo – just a few words you might need to know:[/b]  [b]Furni[/b] – Furniture [b]Bobba[/b] – When a word is filtered, it comes up as “Bobba” [b]Hand[/b] – Where all your furni ends up when you buy it. [b]Console[/b] – The Habbo Messenger [b]Nav[/b] – The Hotel Navigator [b]Norm[/b] – A non-HC member. [b]HC[/b] – Habbo Club', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 107, 835, 94, 13, 2, 1, '[b]Room Games[/b]  [b]DYP, Defend Your Pod[/b] - A popular room game in Habbo, where each Habbo must defend their own pod while trying to sit in another Habbo’s pod for a brief time to get them out.  [b]FF, Falling Furni[/b] - A game where the owner drops furniture, and the Habbos playing have to race to it. ', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 107, 989, 95, 13, 2, 1, '[b]Dhtw, Don’t Hit The Wall[/b] - A dice is rolled and if it is your number, you move up. First one to the wall losses.  [b]CC, Cozzie Change[/b] - A costume change game, where the host announces a theme and you change your clothes to match the theme.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 563, 570, 148, 13, 2, 1, '[b]Staff Members:[/b]  [b]Alex[/b] - Administrator & Developer [b]Copyright[/b] - Community Manager [b]Chris[/b] - Community Manager [b]Siract[/b] - Community Manager  [b]Representatives:[/b]  Joee Elijah UnityX Ultra', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 628, 741, 23, 11000, 3, 4, '', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 667, 611, 35, 13, 0, 4, '[b]Tip 5:[/b] Bouncing on your tile three times locks the square- make shapes out of locked tiles to lock all the tiles within.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 85, 383, 94, 13, 0, 4, '[b][color=#ffce00]Power Drill: [/color][/b][color=#fe6301]Bounce on any tile in  the field to clear it. [/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 369, 317, 20, 13, 4, 4, '[b]Free Battleball[/b]  Yes until further notice we\'re letting you play both SnowStorm and Battleball for free - no tickets required.  [b]Please note:[/b] * skill levels don\'t apply for the free games - everyone can play everyone', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 86, 318, 100, 13, 0, 4, '[b][color=#ffce00]Battle Bomb: [/color][/b][color=#fe6301]Clears all tiles  around it- even yours![/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 30, 30, 16, 13, 2, 4, '[b]Want to know how to play?  Read the instructions in our [url=https://habbolegacy.com/groups/1/id/discussions]discussion forum[/url][/b]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 84, 452, 83, 13, 0, 4, '[b][color=#ffce00]Light Bulb: [/color][/b][color=#fe6301]Turns all the tiles in a  small area your colour.[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 84, 584, 96, 13, 0, 4, '[b][color=#ffce00]Flashlight: [/color][/b][color=#fe6301]Colours all the tiles in a  straight line in front of you[/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 85, 255, 89, 13, 0, 4, '[b][color=#ffce00]Box of pins: [/color][/b][color=#fe6301]Bouncing on these will burst your ball![/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 697, 414, 43, 13, 0, 4, '[b]Tip 3:[/b] Distract your opponent by calling him or her strange names like &quot;llama feet&quot;.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 682, 309, 49, 13, 0, 4, '[b]Tip 2:[/b] Bounce on your own squares multiple times to gain extra points, rather than on empty squares.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 84, 714, 104, 13, 0, 4, '[b][color=#ffce00]Random: [/color][/b][color=#fe6301]Gives you a power-up chosen at random![/color]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 683, 254, 47, 13, 0, 4, '[b]Tip 1:[/b] Bouncing over your opponents squares earns you more points than bouncing on empty squares.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 84, 650, 102, 13, 0, 4, '[b][color=#ffce00]Harlequin: [/color][/b][color=#fe6301]Makes all other players colour tiles for your team.[/color]', 1, '');
