INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 669, 532, 31, 13, 0, 4, '[b]Tip 4:[/b] The best power-up is the  Harlequin, while the worse is the box of pins which can harm you most of all!', 1, '');
