INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 85, 713, 23, 13, 0, 6, '[b]Tips &amp; Tactics[/b]', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 40, 542, 53, 13, 0, 6, 'Moving', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 54, 958, 33, 13, 0, 6, '[color=#d80000][b]Tip 2:[/b][/color] If you are wobbling all over  the place, you can get your  balance back once during  the game using the \'stabilise\' button  (space bar).', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 90, 742, 31, 13, 9, 6, '[color=#d80000][b]Tip 1:[/b][/color] When the game starts, you will see a pop up window. On the right is a balance meter.   When the hand points straight up, you\'re perfectly balanced. When it  points to the right, you need to  balance to the left, and vice versa.   If the hand drops too far either side you have lost your balance and will fall into the water and lose.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 56, 1034, 29, 13, 0, 6, '[color=#d80000][b]Tip 3:[/b][/color] Moving away from your  opponent during a game  will allow you time to balance.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 334, 955, 14, 13, 4, 6, '[color=#d80000][b]The Queue System[/b][/color]  When you have a ticket, get into the pool, swim over and climb on the inflatables to queue for your turn.   The game starts when two players are ready.', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 178, 468, 35, 13, 0, 6, 'Balance', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 43, 488, 51, 13, 0, 6, 'Push', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 336, 745, 25, 13, 4, 6, '[color=#d80000][b]Buying Tickets[/b][/color]  To play Wobble Squabble, you need tickets. You can get tickets by clicking on the inflatables, or by clicking on the ticket machine beside the pool.  Tickets cost [b][color=#fe6301]6 Credits for 20[/color][/b] or [b][color=#fe6301]1 Credit for 2[/color][/b].   In Wobble Squabble the winner stays on, so if you win a game stay on the inflatables and the next one is free!', 1, '');
INSERT INTO cms_stickers (user_id, x, y, z, sticker_id, skin_id, group_id, text, is_placed, extra_data) VALUES (1, 28, 438, 47, 13, 0, 6, 'Balance', 1, '');
